import React from "react";

const Header = () => {
  return (
    <div className="header">
      <div className="container">
        <div className="header__logo">
          <img src="./img/pizza-logo.svg" alt="Pizza logo" />
          <div>
            <h1>Book Google Books Api</h1>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Header;
